import React from 'react'
import { ListGroup, ListGroupItem } from 'reactstrap'

function Menu() {
    return (
        <ListGroup>
            <ListGroupItem tag="a" href="#" action >
                Home 
            </ListGroupItem>
        </ListGroup>
    )
}

export default Menu
